import React from "react";
import { Link } from "react-router-dom";

function Home() {
    return (
        <div>
            <h1>Ласкаво просимо!</h1>
            <Link to="/sign-up">Реєстрація</Link> | <Link to="/sign-in">Вхід</Link>
        </div>
    );
}

export default Home;
